  const { restaurantName } = props.match.params;

  // You can use the restaurantName to customize the booking form
  // For example, you can display the restaurant's name in the form
  // and handle the booking process here.

  return (
    <div>
      <h2>Book a Table at {restaurantName}</h2>
      {/* Your booking form and logic can go here */}
    </div>
  );
};

export default BookingPage;
